import { StrictMode } from "react";
import { createRoot } from "react-dom/client";
import "./styles.css";

function App() {
  return (
    <div className="card">
      <Avatar />
      <div className="data">
        <Intro />
        <SkillList />
      </div>
    </div>
  );
}

function Avatar() {
  return <img className="avatar" src="/avatar.jpeg" alt="Avatar" />;
}

function Intro() {
  return (
    <div>
      <h1>Cody Iddings</h1>
      <p>
        I'm a co-founder of Makeshapes. We're on a mission to democratise
        high-quality team learning. Our unique approach allows organisations to
        scale learning and culture change in a way not previously possible. At
        Makeshapes, I'm responsible for the development, experience, and
        integrity of our product. With an award-winning background in
        innovation, UX, and human-centered design, I am ensuring Makeshapes
        solves the problems of enterprises globally and is user-friendly.
      </p>
    </div>
  );
}

function SkillList() {
  return (
    <div className="skill-list">
      <Skill name="Surfing" />
      <Skill name="Dancing" />
      <Skill name="Cooking" />
      <Skill name="Writing" />
    </div>
  );
}

function Skill(props) {
  console.log(props);
  return;
  <div className="skill">
    <p>{props.name}</p>
  </div>;
}

const rootElement = document.getElementById("root");
const root = createRoot(rootElement);

root.render(
  <StrictMode>
    <App />
  </StrictMode>
);
